To solve the problem programmatically using GNU Octave, we can use the method of Lagrange multipliers. We define the function we want to maximize as f(x, y, z) = xy + xz + yz, and the constraint as g(x, y, z) = x^2 + 2y^2 + 5z^2 - 22 = 0. We then set up the system of equations given by the gradients of f and g, and solve for the critical points. Finally, we evaluate f at these critical points and return the maximum value.

Here is the GNU Octave script to solve the problem:

```
syms x y z lambda
f = x*y + x*z + y*z;
g = x^2 + 2*y^2 + 5*z^2 - 22;
grad_f = [diff(f, x), diff(f, y), diff(f, z)];
grad_g = [diff(g, x), diff(g, y), diff(g, z)];
eqs = [grad_f(1) == lambda*grad_g(1), grad_f(2) == lambda*grad_g(2), grad_f(3) == lambda*grad_g(3), g == 0];
 sol = solve(eqs, x, y, z, lambda);
