function units_digit = find_units_digit (base1, base2, num1, num2)
  % Convert numbers to base 10
  num1_base10 = base2dec (num1, base1);
  num2_base10 = base2dec (num2, base2);

  % Perform subtraction in base 10
  result_base10 = num1_base10 - num2_base10;

  % Convert result back to specified base
  result_base2 = dec2base (result_base10, base2);

  % Extract units digit
  units_digit = result_base2 (1);
endfunction

% Example usage
base1 = 6;
base2 = 6;
num1 = '413';
num2 = '215';
printf ('%.15g\n', find_units_digit (base1, base2, num1, num2));

