octave_code:
function least_sum()
    % Define the product
    product = 84;
    % Initialize variables
    factors = [];
    sum_of_factors = 0;
    % Generate factors
    for i = 1:product
        if mod(product, i) == 0 && i <= sqrt(product)
            factors = [factors, i];
            sum_of_factors = sum_of_factors + i;
            % Divide the product by the factor to avoid repetition
            product = product / i;
        end
    end
    % Add the remaining product (if greater than 1) as a factor
    if product > 1
        factors = [factors, product];
        sum_of_factors = sum_of_factors + product;
    end
    % Calculate the least possible sum
    least_sum = sum_of_factors;
    % Return the result
    printf('%.15g\n', least_sum);
endfunction

