% Define the coordinates of the 14 cubes
location = [1, 0, 0; 0, 1, 0; 0, 0, 0.45; 1, 1, 0.45; 2, 1, 0.45; 1, 0, 1.45; 2, 0, 1.45; 3, 0, 1.45; 3, 1, 1.45; 3, 2, 1.45; 2, 2, 1.45; 1, 2, 1.45; 0, 2, 1.45; 0, 1, 1.45];

% Calculate the number of red faces for each cube
num_red_faces = zeros(size(location, 1), 1);
for i = 1:length(location)
    x = location(i, 1);
    y = location(i, 2);
    z = location(i, 3);

    % Count the number of faces that are on the surface
    if x == 0 || x == 3 || y == 0 || y == 2 || z == 0 || z == 1.45
        num_red_faces(i) = 3; % 3 faces on the surface
    else
        num_red_faces(i) = 4; % 4 faces on the surface
    end
end

% Count the number of cubes with exactly four red faces
count = sum(num_red_faces == 4);

% Print the final answer
printf('%d\n', count);

