To solve this problem programmatically in GNU Octave, we need to determine for which values of $n$ the equation $x(x+5) = -n$ has no real solutions. The equation can be rewritten as $x^2 + 5x + n = 0$. For this quadratic equation to have no real solutions, the discriminant must be negative. The discriminant $\Delta$ of a quadratic equation $ax^2 + bx + c = 0$ is given by $\Delta = b^2 - 4ac$. In our case, $a = 1$, $b = 5$, and $c = n$, so $\Delta = 5^2 - 4 \cdot 1 \cdot n = 25 - 4n$. We need to find the values of $n$ for which $\Delta < 0$, i.e., $25 - 4n < 0$, which simplifies to $n > \frac{25}{4} = 6.25$. Since $n$ is an integer between 1 and 10 inclusive, the values of $n$ that satisfy this inequality are $7, 8, 9, 10$. Therefore, there are 4 values of $n$ out of 10 that result in no real solutions. The probability is thus $\frac{4}{10} = \frac{2}{5}$.

Here is the GNU Octave script to solve the problem:

```octave
n = 1:10;
count = sum(n > 6.25);
probability = count / length(n);
printf('%.15g\n', probability);
```

