To solve the problem, we can use the Law of Sines. The Law of Sines states that in any triangle, the ratio of the length of a side to the sine of the opposite angle is the same for all three sides. In this case, we have:

$\frac{AB}{\sin C} = \frac{BC}{\sin A}$

We can solve for BC by rearranging the equation:

$BC = \frac{AB \cdot \sin A}{\sin C}$

Now, we can substitute the given values into the equation and solve for BC:

$BC = \frac{20 \cdot \sin 30^\circ}{\sin 45^\circ}$

To calculate the sine values, we can use the sind() function in Octave. Here's the Octave script to solve the problem:

```
AB = 20;
angle_A = sind(30);
angle_C = sind(45);
BC = AB * angle_A / angle_C;
printf('%.15g\n', BC);
```

