function p = solveProblem()
    % Calculate the probability that Team A is selected on at least two of the next three days
    % There are 3 teams, and 2 teams are selected each day
    % The probability of Team A being selected on a given day is 1/3
    % The probability of Team A not being selected on a given day is 2/3

    % Calculate the probability of Team A being selected on exactly 2 days
    pexactly2 = (3 choose 2) * (1/3)^2 * (2/3)^1;

    % Calculate the probability of Team A being selected on exactly 3 days
    pexactly3 = (3 choose 3) * (1/3)^3 * (2/3)^0;

    % Calculate the total probability of Team A being selected on at least 2 days
    p = pexactly2 + pexactly3;

    % Print the final answer
    printf('%.15g\n', p);
endfunction

% Call the function to solve the problem
solveProblem();

