# Calculate the probability of rolling a 5 on at least one of two six-sided dice
# using the complementary probability approach.

# Probability of not rolling a 5 on a single die
p_not_5_single = 5/6;

# Probability of not rolling a 5 on either die
p_not_5_both = p_not_5_single * p_not_5_single;

# Probability of rolling a 5 on at least one die
p_5_at_least_one = 1 - p_not_5_both;

printf('%.15g\n', p_5_at_least_one);

model_output_raw:
To calculate the probability of rolling a 5 on at least one of two six-sided dice, we can use the complementary probability approach. The complementary event is that a 5 is not rolled on either die. The probability of not rolling a 5 on a single die is 5/6. Therefore, the probability of not rolling a 5 on either die is (5/6) * (5/6) = 25/36. The probability of rolling a 5 on at least one die is 1 minus the probability of not rolling a 5 on either die, which is 1 - 25/36 = 11/36. Here's the Octave script to calculate this probability:

```
# Calculate the probability of rolling a 5 on at least one of two six-sided dice
# using the complementary probability approach.

# Probability of not rolling a 5 on a single die
p_not_5_single = 5/6;

# Probability of not rolling a 5 on either die
p_not_5_both = p_not_5_single * p_not_5_single;

# Probability of rolling a 5 on at least one die
p_5_at_least_one = 1 - p_not_5_both;

printf('%.15g\n', p_5_at_least_one);
```

