question:
In circle $J$, $HO$ and $HN$ are tangent to the circle at $O$ and $N$. Find the number of degrees in the sum of $m\angle J$ and $m\angle H$. [asy]
size(150);
import graph;
pair J = (0,0), H = (6,0), O, N;
path circ = Circle(J,3);
pair M = midpoint(J--H);
path secCirc = Circle(M,3);
pair[] tangentPoints = intersectionpoints(circ,secCirc);
O = tangentPoints[0]; N = tangentPoints[1];
draw(J--N--H--O--cycle);
draw(circ);
label("$H$",H,E);
label("$J$",J,W);
label("$N$",N,S);
label("$O$",O,NE);
[/asy]

octave_code:
# Define the radius of the circle
r = 3;

# Calculate the length of the tangent segments
ho = sqrt(H(1)^2 + H(2)^2 - 2*H(1)*r + r^2);
hn = ho;

# Calculate the length of the chord ON
on = 2*sqrt(r^2 - (r - ho/2)^2);

# Calculate the angles J and H
angle_J = asin(on/(2*r));
angle_H = asin(ho/(2*r));

# Calculate the sum of the angles J and H
sum_of Angles = angle_J + angle_H;

# Print the final answer
printf('%.15g\n', sum_of Angles * 180 / pi);

