function count_arrangements = count_arrangements(word)
    unique_letters = unique(word);
    arrangements = factorial(length(word));
    for i = 1:length(unique_letters)
        if count word(word, unique_letters(i)) > 1
            arrangements = arrangements / factorial(count word(word, unique_letters(i)));
        end
    end
    count_arrangements = arrangements;
endfunction

