octave_code:
# Given values
BC = 12;
area_ABC = 180;

# Calculate the height of triangle ABC
height_ABC = 2 * area_ABC / BC;

# Since AB = AC and AD is an altitude, triangle ABD and ACD are congruent
# Therefore, the height of triangle ABD is the same as the height of triangle ABC
height_ABD = height_ABC;

# Since AB is parallel to DE, triangle ADE is similar to triangle ABD
# The ratio of the sides of triangle ADE to triangle ABD is the same as the ratio of AE to AC
# AE = AC - EC, and since AB is parallel to DE, EC = BC/2 = 6
# Therefore, AE = AC - 6 = AB - 6
# Since AB = AC, AE = AB - 6
# The ratio of AE to AC is (AB - 6) / AB = 1 - 6/AB
# The area of triangle ADE is the area of triangle ABD times the square of the ratio of AE to AC
area_ADE = area_ABD * (1 - 6/AB)^2;

# The area of quadrilateral ABDE is the area of triangle ABD minus the area of triangle ADE
area_ABDE = area_ABD - area_ADE;

printf('%.15g\n', area_ABDE);

