The grid is 6x6, so there are 7 horizontal and 7 vertical lines. We need to choose 2 lines from each set such that the distance between them is 3 units.

Here's the Octave script to calculate the number of rectangles:

```
# Define the number of lines
num_lines = 7;

# Calculate the number of ways to choose 2 lines from 7
num_ways = comb(num_lines, 2);

