num lines_to_choose = num_lines - 3;

# Calculate the number of ways to choose 2 lines from the remaining lines
num_ways_to_choose = comb(num_lines_to_choose, 2);

# The total number of rectangles is the product of the two combinations
total num rectangles = num_ways * num_ways_to_choose;

printf('%.15g\n', total num rectangles);
```

