function product = octal_product(a, b)
  % Convert octal numbers to decimal
  decimal_a = octal_to_decimal(a);
  decimal_b = octal_to_decimal(b);

  % Calculate the product in decimal
  decimal_product = decimal_a * decimal_b;

  % Convert the product back to octal
  product = decimal_to octal(decimal_product);
endfunction

function decimal = octal_to_decimal(octal)
  % Convert an octal number to decimal
  decimal = str2num(octal);
endfunction

function octal = decimal_to octal(decimal)
  % Convert a decimal number to octal
  octal = base2 octal(decimal);
endfunction

